		"id": 1035256270465445900,
		"id_str": "1035256270465445891",
		"full_text": "Technically, this wouldn't be \"infinite sexes\" but 7.4 billion sexes is functionally close for our brains. Now, our medicine isn't advanced enough for THAT level of detail to make any difference. BUT IT MIGHT BE in the future. Individualized medicine!\n\n/22",
